import { Link } from 'react-router-dom';

const Home = () => {
    return (
        <div>
            <h1 className="font-bold text-center text-2xl p-4">
                Marwari Colleg Important Question
            </h1>
            <div>
                <Link to="/sem-4"> Semester 4</Link>
            </div>
        </div>
    );
};

export default Home;
